import React from "react";
import "./App.css";
import Map from "pigeon-maps";
import { useWindowSize } from "react-use";



const hubei = [30.97564, 112.2707];


function App() {
  const { width, height } = useWindowSize();

  return (
    <div className='App'>
            <Map
        defaultCenter={hubei}
        zoom={5}
        width={width}
        height={height - 4}
      >
      </Map>
    </div>
  );
}

export default App;
